import { Link, useParams } from 'react-router-dom';
import { MdNavigatePrevious } from 'react-icons/md';
import { IconContext } from 'react-icons';

const CommentGoBack = () => {
	const { id } = useParams();
	return (
		<Link className="commentGoBack" to={`/blogs/${id}`}>
			<IconContext.Provider value={{ color: 'red', size: '1.25rem' }}>
				<MdNavigatePrevious />
			</IconContext.Provider>
			Back to Blog
		</Link>
	);
};

export default CommentGoBack;
